import React from 'react';
import {
	AiOutlineDelete,
	AiOutlinePlusCircle,
	AiOutlineMinusCircle,
} from 'react-icons/ai';

const CartRow = ({ item }) => {
	const { name, price, count, total } = item;
	return (
		<div>
			<div className='col-2'>{name}</div>
			<div className='col-3'>{price}$</div>
			<div className='col-4'>
				<AiOutlineMinusCircle className='decre' />
				<p className='count'>{count}</p>
				<AiOutlinePlusCircle className='incre' />
			</div>

			<div className='col-5'>
				<AiOutlineDelete />
			</div>
			<div className='col-6'>{total}$</div>
		</div>
	);
};

export default CartRow;
